import React, { useEffect, useState } from 'react';
import { Card } from './components/t';
import axios from 'axios';


function App() {
  const [data, setData] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://127.0.0.1:5000/clients');
        if(!response.ok){
          throw new Error("Network response wasn't good :(");
        }
        const result = await response.json();
        setData(result.clients);
      }catch (err){
        console.log("Error while attempting to format the data: ", err);
      }
    }

    fetchData();
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <ul>
          {
            data.map((item) => (
              <li key={item.id}></li>
            ))
          }
        </ul>
      </header>
    </div>
  );
}

export default App;
